import {
  Card,
  CardContent,
  Button,
  ButtonGroup,
  Typography
} from "@mui/material";

import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid';

const Calendar = ()=>{
  const design = (
    <>
      <Card className="shadow-sm border">
        <CardContent>Calendar</CardContent>
      </Card>
    </>
  );
  return design;
}

export default Calendar;
